Querying localized data in MongoDB<p>Having data 'localized' like this:</p>
<pre><code>{
  &quot;cs&quot;: [
    {
      &quot;cID&quot;: &quot;00001&quot;,
      &quot;title&quot;: {
        &quot;en&quot;: &quot;title en1&quot;,
        &quot;de&quot;: &quot;title de1&quot;
      },
      &quot;desc&quot;: {
        &quot;en&quot;: &quot;desc en1&quot;,
        &quot;de&quot;: &quot;desc de1&quot;
      },
      &quot;startDate&quot;: 20210801,
      &quot;endDate&quot;: 20210809,
      &quot;numDays&quot;: 8
    },
    {
      &quot;cID&quot;: &quot;00002&quot;,
      &quot;title&quot;: {
        &quot;en&quot;: &quot;title en2&quot;,
        &quot;de&quot;: &quot;title de2&quot;
      },
      &quot;desc&quot;: {
        &quot;en&quot;: &quot;desc en2&quot;,
        &quot;de&quot;: &quot;desc de2&quot;
      },
      &quot;startDate&quot;: 20210701,
      &quot;endDate&quot;: 20210715,
      &quot;numDays&quot;: 14
    }
  ]
}
</code></pre>
<p>What would be the best way to query this taking user locale (passed to query as param) into account? For example, if &quot;en&quot; was passed, the query should return this for &quot;cID&quot;: &quot;00001&quot; :</p>
<pre><code>    {
      &quot;cID&quot;: &quot;00001&quot;,
      &quot;title&quot;: &quot;title en1&quot;,
      &quot;desc&quot;: &quot;desc en1&quot;,
      &quot;startDate&quot;: 20210801,
      &quot;endDate&quot;: 20210809,
      &quot;numDays&quot;: 8
    }
</code></pre>
<p>Ideally, the query should be 'generic' and not filter specifically the 'title' and 'desc' objects.</p>
<p>I know that:</p>
<pre><code>db.cs.find({
  &quot;cID&quot;: &quot;00001&quot;
},
{
  &quot;_id&quot;: 0,
  &quot;cID&quot;: 1,
  &quot;title&quot;: &quot;$title.en&quot;,
  &quot;desc&quot;: &quot;$desc.en&quot;,
  &quot;startDate&quot;: 1,
  &quot;endDate&quot;: 1,
  &quot;numDays&quot;: 1
})
</code></pre>
<p>will give me:</p>
<pre><code>[
  {
    &quot;cID&quot;: &quot;00001&quot;,
    &quot;desc&quot;: &quot;desc en1&quot;,
    &quot;endDate&quot;: 2.0210809e+07,
    &quot;numDays&quot;: 8,
    &quot;startDate&quot;: 2.0210801e+07,
    &quot;title&quot;: &quot;title en1&quot;
  }
]
</code></pre>
<p>but it would be tricky to handle it with many locales and different data models in different queries.</p>
<p>Mongo playground: <a href="https://mongoplayground.net/p/9erh-VYiOO4" rel="nofollow noreferrer">https://mongoplayground.net/p/9erh-VYiOO4</a></p>

