<p>I have a list of ingredients that I would like to search. The ingredients are in several languages and I like to take care of singular and plural.</p>
<p>Here is my example</p>
<p><strong>Schema</strong></p>
<pre class="lang-json prettyprint-override"><code>{
  translation: [
    {
      language: {
        type: String,
        required: true
      },
      name: {
        type: String,
        required: true
      }
    }
  ],
  calories: {
    &quot;type&quot;: Number
  },
  protein: {
    &quot;type&quot;: Number
  },
  carbohydrate: {
    &quot;type&quot;: Number
  },
  fat: {
    &quot;type&quot;: Number
  }
}
