<pre><code>foodSchema.index( { &quot;translation.name&quot;: &quot;text&quot; }, { default_language: &quot;german&quot; } )
</code></pre>
<p><strong>Read Index from DB</strong></p>
<pre><code>[
    {
        &quot;v&quot; : 2,
        &quot;key&quot; : {
            &quot;_id&quot; : 1
        },
        &quot;name&quot; : &quot;_id_&quot;
    },
    {
        &quot;v&quot; : 2,
        &quot;key&quot; : {
            &quot;_fts&quot; : &quot;text&quot;,
            &quot;_ftsx&quot; : 1
        },
        &quot;name&quot; : &quot;translation.name_text&quot;,
        &quot;default_language&quot; : &quot;german&quot;,
        &quot;background&quot; : true,
        &quot;weights&quot; : {
            &quot;translation.name&quot; : 1
        },
        &quot;language_override&quot; : &quot;language&quot;,
        &quot;textIndexVersion&quot; : 3
    }
]
</code></pre>
<p><strong>Records</strong></p>
<pre><code>{
  calories: 1,
  protein: 2,
  carbohydrate: 3,
  fat: 4,
  translation: [
    {
      _id: ObjectId('5fba87d13ad6404108191670'),
      language: 'german',
      name: 'gurke'
    },
    {
      _id: ObjectId('5fba87d13ad6404108191671'),
      language: 'english',
