      language: 'german',
      name: 'huhn'
    },
    {
      _id: ObjectId('5fba87d13ad6404108191675'),
      language: 'english',
      name: 'chicken'
    },
    {
      _id: ObjectId('5fba87d13ad6404108191676'),
      language: 'spanish',
      name: 'pollo'
    }
  ]
}
</code></pre>
<p><strong>Searching data</strong></p>
<pre class="lang-js prettyprint-override"><code>db.getCollection('foods').find({$text: { $search: &quot;gurke&quot; }}) //works
db.getCollection('foods').find({$text: { $search: &quot;gurken&quot; }}) //works
db.getCollection('foods').find({$text: { $search: &quot;cucumber&quot; }}) //works
db.getCollection('foods').find({$text: { $search: &quot;cucumbers&quot; }}) //works
db.getCollection('foods').find({$text: { $search: &quot;huhn&quot; }}) //works
db.getCollection('foods').find({$text: { $search: &quot;hhner&quot; }}) //works
db.getCollection('foods').find({$text: { $search: &quot;chicken&quot; }}) // no result
db.getCollection('foods').find({$text: { $search: &quot;chickens&quot; }}) //no result
db.getCollection('foods').find({$text: { $search: &quot;pepino&quot; }}) //no result
</code></pre>
<p>The documentation from MongoDb says: <a href="https://docs.mongodb.com/manual/tutorial/specify-language-for-text-index/" rel="nofollow noreferrer">https://docs.mongodb.com/manual/tutorial/specify-language-for-text-index/</a></p>
<blockquote>
<p>The default language associated with the indexed data determines the
rules to parse word roots (i.e. stemming) and ignore stop words.</p>
</blockquote>
<ul>
<li>Does it means that only the default language is supported?</li>
<li>Why is it working for cucumber but not for chicken?</li>
</ul>
<p>I was also checking the stop words for any chicken. <a href="https://github.com/mongodb/mongo/blob/master/src/mongo/db/fts/stop_words_english.txt" rel="nofollow noreferrer">https://github.com/mongodb/mongo/blob/master/src/mongo/db/fts/stop_words_english.txt</a></p>
<p>Thank you for your help!</p>

